import React from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { solid } from "@fortawesome/fontawesome-svg-core/import.macro"; // <-- import styles to be used
//form page
const ListBuild = (props) => {
  const {
    next,
    elements,
    buildN,
    buildM,
    buildAT,
    buildA,
  } = props;  

console.log(elements)

  function handleNext(event) {
    event.preventDefault();
    next();
  }

  function nutritonBuild(event) {
    event.preventDefault();
    const miscE = document.getElementById('miscId')
    const nutritionE = document.getElementById('nutritionId')
    const allE = document.getElementById('allId')
    const athleticsE = document.getElementById('athleticsId')
    nutritionE.className = 'btn btn-warning'
    miscE.className = 'btn btn-outline-warning'
    athleticsE.className = 'btn btn-outline-warning'
    allE.className = 'btn btn-outline-warning'
    buildN();
  }

  function allBuild(event) {
    event.preventDefault();
    const miscE = document.getElementById('miscId')
    const nutritionE = document.getElementById('nutritionId')
    const allE = document.getElementById('allId')
    const athleticsE = document.getElementById('athleticsId')
    allE.className = 'btn btn-warning'
    miscE.className = 'btn btn-outline-warning'
    athleticsE.className = 'btn btn-outline-warning'
    nutritionE.className = 'btn btn-outline-warning'
    buildA();
  }
  function athleticBuild(event) {
    event.preventDefault();
    const miscE = document.getElementById('miscId')
    const nutritionE = document.getElementById('nutritionId')
    const allE = document.getElementById('allId')
    const athleticsE = document.getElementById('athleticsId')
    athleticsE.className = 'btn btn-warning'
    miscE.className = 'btn btn-outline-warning'
    allE.className = 'btn btn-outline-warning'
    nutritionE.className = 'btn btn-outline-warning'
    buildAT();
  }
  function miscBuild(event) {
   const miscE = document.getElementById('miscId')
   const nutritionE = document.getElementById('nutritionId')
   const allE = document.getElementById('allId')
   const athleticsE = document.getElementById('athleticsId')
   miscE.className = 'btn btn-warning'
   allE.className = 'btn btn-outline-warning'
   athleticsE.className = 'btn btn-outline-warning'
   nutritionE.className = 'btn btn-outline-warning'
    event.preventDefault();
    buildM();
  }




  //the div and form of buttons
  return (
    <div>
      <div>
      <h1
              className="text-warning justify-content-center"
              style={{ fontSize: "50px",position:'relative',top:'0em', fontFamily: '"Play", sans-serif', }}
            >
              Marketplace
            </h1>
      <details className="nav justify-content-center" >
            <li id='allId' className="btn btn-warning" onClick={allBuild} style={{margin: '1em'}} >
                All Items
            </li>
            <li id='nutritionId'className="btn btn-outline-warning" onClick={nutritonBuild} style={{margin: '1em'}}>
                Nutrition
            </li>
            <li id='athleticsId' className="btn btn-outline-warning" onClick={athleticBuild} style={{margin: '1em'}}>
               Athletics
            </li>
            <li id="miscId" className="btn btn-outline-warning" onClick={miscBuild} style={{margin: '1em'}}>
                Misc
            </li>
          </details>

        {elements()}

          <button className="next btn rounded-pill" style={styles.next} onClick={handleNext}>            
          <FontAwesomeIcon
                  icon={solid("people-group")}
                  style={{ fontSize: 35, marginRight: '50%',color: '#c1b0bc'}}
                /></button>
        </div>
      </div>
  );
}

//styles
const styles = {


}

export default ListBuild
